import React from 'react';
import Link from 'next/link';
import Head from 'next/head';
import AppLayout from '../components/Applayout';

const Home = () => {
	return (
		<>
			<Head>
				<title>NodeBird</title>
				<link
					rel="stylesheet"
					href="https://cdnjs.cloudflare.com/ajax/libs/antd/4.0.4/antd.css"
				/>
			</Head>
			<AppLayout>
				<Link href="/about">
					<a>about</a>
				</Link>
				<div>Hello, Next!!</div>
			</AppLayout>
		</>
	);
};

export default Home;
